import torch

try:
    # Load the results generated by the predict command
    data = torch.load('predictions_118.pt')
    print("\n--- PREDICTION RESULTS (IEEE 118 Bus) ---\n")
    
    # Check what kind of data we got back
    if isinstance(data, dict):
        # If it's a dictionary, print keys and shapes
        for key, value in data.items():
            print(f"Key: {key}")
            if hasattr(value, 'shape'):
                print(f"Shape: {value.shape}")
                print(f"Values: {value[:5]}") # Show first 5 numbers
    else:
        # If it's a raw tensor
        print(f"Data Shape: {data.shape}")
        print("First 5 Predicted Values (Voltages/Angles):")
        print(data[:5])

except FileNotFoundError:
    print("Error: Could not find 'predictions_118.pt'. Make sure the predict command finished!")
except Exception as e:
    print(f"An error occurred: {e}")